    'image' => 'uploadfile/2009/0414/20090414044241618.jpg',
    'description' => '　　《知音》杂志创刊于1985年。高举“人情美，人性美”的旗帜，坚持“篇篇可读、期期精彩”的精品办刊意识。锐意求新，开拓进取，始终把握着时代的脉搏。多层次、多方位、多视角地展示社会生活中真实与广阔的精彩画面，赢得了读者厚爱，月发行量高达680余万册，连续四届被评为全国百种重点社科期刊之一；当代最受欢迎的中国期刊之一；世界综合性期刊最新排名第五位；《知音》创刊20多年以来，多次受到中宣部、国家新闻出版局的表扬和嘉奖，被评为历届全国优秀期刊，荣获国家期刊奖，进入“全国百种社科期刊”和“中国期刊方阵”。',
