    'description' => '　　1988年女友杂志社成立，同时诞生了《女友》月刊。20年来，《女友》两次被列入“全国百种重点社科期刊”；两次进入“全国读者最喜爱的十家杂志”； 2002年，第二届“全国国民阅读与购买倾向抽样调查”中，《女友》被评为“读者最喜爱的杂志”第四名；34岁以下年轻女性最喜欢看的杂志中，《女友》排第二位；《女友》荣膺中国期刊方阵最高层次“双高期刊”，并获得期刊最高奖项——“国家期刊奖”。她以鲜明的特色，较高的文化含量和文化品位，以信息、知识、思想和审美的高要求、高标准，精美的装帧设计和印刷，突出而成功的广告质量和效应，造就了自己的品牌优势。',
