    'style' => '',
    'image' => 'uploadfile/2009/0331/20090331042300449.jpg',
    'description' => '　　体线fitness致力于传达这样的理念：每个女人都因健康与信心而拥有神奇的力量。这力量将让fitness的读者足以自由地主导自己的生活，突破全部的局限，实现未来的梦想。体线fitness相信，这样的力量来自我们的读者自身。fitness的目的与价值，就是和读者一起去建立和发现这种力量蜒fitness的精神、身体和信念。
　　Fitness的名望来自对女性身心健康的全方位关注和报道，而远不止于身材。Fitness提供最直接、最实用、最有效的方法和信心，与今天社会生活中那些最具活力的女性，建立一种亲密的关系，帮助她们更好地应对生活中的压力，获得健康身心。
　　Fitness为在快速发展的世界中精力充沛的女人而存在。帮助她们找到生活、身体和精神的平衡之道。
　　对今天越来越多的独立而充满活力的女性来说，好身材和好心情，绝不是生活的全部，但一定是生活必不可少的部分。',
