    'image' => 'uploadfile/2009/0508/20090508041143101.jpg',
    'description' => '　　中国北京出版的《父母必读》，是一本深受中国家庭欢迎的名牌月刊，“父母必读”四个字由宋庆龄题写。本杂志融育儿、教儿、亲子等内容为一体，兼长知识性和趣味性，以寓教于乐的形式给父母培育孩子众多的建议和忠告，辟有精彩栏目，就孩子成长过程中遇到的种种问题和读者展开讨论。 

