    'style' => '',
    'image' => 'uploadfile/2009/0415/20090415051323180.jpg',
    'description' => '　　中国权威的高档全彩妇婴月刊，为妈妈和宝宝提供全面的信息及指导。

　　《母子健康》（原《大众优生》）创刊于1992年，由中华人民共和国卫生部主管，中日友好医院、中国优生科学协会主办。《母子健康》自创刊以来一直致力于向广大读者传播优生、优育、优教知识，并在科学严谨的基础上，增强了杂志的趣味性、时尚性、可读性及实用性。做为一本融医学性、权威性、生活性、时尚性为一体的健康生活指南，我们聚焦在母亲和宝宝的健康，让妈妈宝宝不仅拥有健康的身体，还有健康的心理，健康的情感，以及健康时尚的生活方式，为母亲和宝宝营造轻松健康的生活氛围，让健康渗透生活的每一个细节。

　　就在这一刻，06年3月号《母子健康》全新改扩版啦！今年，我们的制作班底更专业、更优秀,我们会投入更大的热情和专注来回报您对我们的支持与厚爱。

　　更专业

　　为了让读者能得到最专业、最科学、最诚恳的建议和指导，我们成立了由专业领域中挑选出的“特约专家小组”，同时也会慎重的选取我们的合作伙伴，因为只有“强强联合”才会激发出更强大的竞争力！

　　兼具时尚与品位

　　具有良好教育背景和现代观念的社会“新贵”已经成为我们的主流受重群体。新的《母子健康》将以敏锐的洞察力捕捉更多的时尚元素，融入现代生活的氛围。

　　内容丰富更超值

　　全面改、扩版后的《母子健康》拥有清晰地版块划分和160页的超容量内涵，隆重登场的“妈妈时间”、“新好爸爸”、“亲亲宝贝”等版块和一本每期都会随刊赠送的实用手册，相信会更您带来更多地亮点和期待！',
