    'description' => '　　家庭医学杂志是由国家卫生部主管、中华预防医学会主办的国家级医学科普刊物，国内外公开发行。本刊集权威性、科学性、实用性、知识性、趣味性于一体，图文并茂，知识丰富，是您家庭的健康保证，生活保健的向导，医疗咨询的指南，心理、生理健康的源泉。

